import { Link } from "react-router-dom";
import {
  Box,
  TextField,
  MenuItem,
  FormControl,
  Typography,
  Grid,
  Divider,
  Chip,
} from "@mui/material";
import { LoadingButton } from "@mui/lab";
import Login from "../../components/auth/Login";

const LoginPage = () => {
  return (
    <>
      <Typography
        variant="h4"
        sx={{ color: "primary.main", textAlign: "center" }}
      >
        Green Cells
      </Typography>
      <Typography variant="h4" fontWeight="bold" sx={{ textAlign: "center" }}>
        Conectare
      </Typography>
      <Box
        component="div"
        sx={{
          display: "flex",
          flexDirection: "column",
          flexWrap: "wrap",
          maxWidth: 400,
          border: ".1px solid lightgray",
          borderRadius: ".3rem",
        }}
        mt={2}
        ml="auto"
        mr="auto"
        p={4}
        gap={2}
      >
        <Login />
      </Box>
      <Box
        component="div"
        sx={{
          display: "flex",
          flexDirection: "column",
          flexWrap: "wrap",
          textAlign: "center",
          maxWidth: 400,
          border: ".1px solid lightgray",
          borderRadius: ".3rem",
        }}
        mt={2}
        ml="auto"
        mr="auto"
        p={2}
      >
        <Typography variant="body1" component="span" fontWeight={500}>
          Nu ai un cont?{" "}
          <Link to="/register">
            <Typography
              sx={{ color: "primary.main" }}
              variant="body1"
              component="span"
            >
              CreazÄƒ cont nou
            </Typography>
          </Link>
          .
        </Typography>
      </Box>
    </>
  );
};

export default LoginPage;
